  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0109905 includes biological,
  chemical, discrete sample, physical and profile data collected from Ryofu Maru II
  in the North Pacific Ocean from 2005-06-15 to 2005-07-04 and retrieved during cruise
  49RY20050615 and RF05-06 Leg.1. These data include ALKALINITY, AMMONIUM, CHLOROFLUOROCARBON-11
  (CFC-11), CHLOROFLUOROCARBON-12 (CFC-12), CHLOROPHYLL A, DELTA CARBON-13, DISSOLVED
  INORGANIC CARBON, DISSOLVED ORGANIC CARBON, DISSOLVED OXYGEN, HYDROSTATIC PRESSURE,
  NITRATE, NITRATE + NITRITE CONTENT (CONCENTRATION), NITRITE, PHAEOPHYTIN, PHOSPHATE,
  Potential temperature (theta), SALINITY, SIGMA-THETA, SILICATE, TOTAL PHOSPHORUS,
  WATER TEMPERATURE and pH. The instruments used to collect these data include CTD
  and bottle. These data were collected by Sukeyoshi Takatani of Japan Meteorological
  Agency and Masao Ishii of Meteorological Research Institute; Geochemical Research
  Department as part of the PACIFICA_49RY20050615 data set.nnThe International CLIVAR
  Global Ocean Carbon and Repeat Hydrography Program carries out a systematic and
  global re-occupation of select WOCE/JGOFS hydrographic sections to quantify changes
  in storage and transport of heat, fresh water, carbon dioxide (CO2), and related
  parameters.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
